import { Button, Popover, UncontrolledPopover } from "reactstrap";
import Cart from "./cart";

export default function PopOver() {
  return (
    <div>
      <Button
        id='Popover1'
        type='button'>
        Launch Popover
      </Button>
      <Popover
        flip
        target='Popover1'
        toggle={function noRefCheck() {}}>
        <PopoverHeader>Cart</PopoverHeader>
        <PopoverBody>
          <Cart />
        </PopoverBody>
      </Popover>
    </div>
  );
}
